import * as React from "react";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import PodcastsPage from "../screens/PodcastsPage";
import AccueilPage from "../screens/AccueilPage";
import ForumPage from "../screens/ForumPage";
import CreateSubject from "../component/CreateSubject";
import PlayPodcast from "../component/PlayPodcast";
import ForumSubject from "../component/ForumSubject";
import Abonnement from "../component/Abonnement";
import Coach from "../component/Coach";
import ListChallenge from "../component/ListChallenge";
import DetailChallenge from "../component/DetailChallenge";
import ProfilPage from "../screens/ProfilPage";
import { FontAwesomeIcon } from "@fortawesome/react-native-fontawesome";
import {
  faHome,
  faPodcast,
  faCalendarAlt,
  faComments,
} from "@fortawesome/free-solid-svg-icons";

const Tab = createBottomTabNavigator();

export default function Menu() {
  return (
    <Tab.Navigator
      screenOptions={({ route }) => ({
        tabBarIcon: () => {
          let iconName;

          if (route.name === "Accueil") {
            iconName = faHome;
          } else if (route.name === "Podcasts") {
            iconName = faPodcast;
          } else if (route.name === "Forum") {
            iconName = faComments;
          } else if (route.name === "Event") {
            iconName = faCalendarAlt;
          } else {
            iconName = faHome;
          }

          return <FontAwesomeIcon icon={iconName} color={"white"} size={25} />;
        },
      })}
      tabBarOptions={{
        showLabel: false,
        style: {
          backgroundColor: "#BD7B49",
        },
      }}
    >
      <Tab.Screen name="Accueil" component={AccueilPage} />
      <Tab.Screen name="Podcasts" component={PodcastsPage} />
      <Tab.Screen name="Forum" component={ForumPage} />
      <Tab.Screen
        name="Profil"
        component={ProfilPage}
        options={{ tabBarButton: () => null }}
      />
      <Tab.Screen
        name="CreateSubject"
        component={CreateSubject}
        options={{ tabBarButton: () => null }}
      />
      <Tab.Screen
        name="PlayPodcast"
        component={PlayPodcast}
        options={{ tabBarButton: () => null }}
      />
      <Tab.Screen
        name="ForumSubject"
        component={ForumSubject}
        options={{ tabBarButton: () => null }}
      />
      <Tab.Screen
        name="Abonnement"
        component={Abonnement}
        options={{ tabBarButton: () => null }}
      />
      <Tab.Screen
        name="ListChallenge"
        component={ListChallenge}
        options={{ tabBarButton: () => null }}
      />
      <Tab.Screen
        name="DetailChallenge"
        component={DetailChallenge}
        options={{ tabBarButton: () => null }}
      />
      <Tab.Screen
        name="Coach"
        component={Coach}
        options={{ tabBarButton: () => null }}
      />
    </Tab.Navigator>
  );
}
